// import {  Link } from "react-router-dom";
import React from "react";
const NavBar =()=>{
    return(
<div className="main-nav-bar">
<nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/blogs">Blogs</Link>
          </li>
          <li>
            <Link to="/contact">Contact</Link>
          </li>
        </ul>
      </nav>
</div>
    )
}
export default NavBar;
